import React from 'react';
import s from './Select.module.css';

const Select = (props) => {
  return (
      <select className={s.select} value={props.value} onChange={event => props.onChange(event.target.value)}>
        <option disabled hidden>Не выбрано</option>
        {props.handle()}
      </select>
  );
};

export default Select;
